def restoreChemicalFormula(List<String> e, String f) {
	println "-----"
	Queue<String> s = [] as Queue
	//Stack<String> s = new Stack<>()
	s.add("")
	int size = f.size()
    f += "  "
	def lower = f.toLowerCase()
	Set<String> elements = new HashSet<>(e)
	Set<Integer> seen = new HashSet<>()
	
	int iters = 0, adds = 0
	def answers = []
	int offset = 0, lim=10
	
    for(; s.isEmpty() == false; ){
		println s
		iters++
		
		if(s.peek().size() >= offset + lim){
			seen.clear()
			answers << s.peek().substring(0, lim)
			if(s.isEmpty() == false){
				println "Before $s"
				Queue temp = [] as Queue
				for(; s.isEmpty() == false; ){
					
					temp.add(s.poll().substring(lim))
				}
				s = temp
				println "After $s"
			}
			offset += lim
			continue
		}
		
		String F = s.poll()
		//String F = s.pop()
        int i = F.size() + offset
				
        if(i == size){
			println "Iters: $iters"
			println "Seen size ${seen.size()}"
			println "Adds $adds"
			println F
			println F.size()
			println answers.join("") + F
			return answers.join("") + F
        }

		
		String x = f[i]
		String y = x + lower[i+1]

		boolean oneFlag = false
		//println "seenFlag for '$F' $seenFlag ${i + F.hashCode()}"
		if(x in elements && seen.add(i+(F+x).toLowerCase().hashCode())){
			s.add(F+x)
			adds++
		}
		
		if(y in elements && seen.add(i+(F+y).toLowerCase().hashCode())){
			s.add(F+y)
			adds++
		}

		
			
    }
	println "No answer"
	return ""
}
